import Link from "next/link";
import React, { useEffect, useState } from "react";

const Header = () => {
  const [links, setLinks] = useState([
    { name: "Home", url: "/" },
    { name: "Live competitions", url: "/live-competitions" },
    { name: "How to play?", url: "/how-to" },
    { name: "Home", url: "/" },
  ]);

  useEffect(() => {
    console.log(links);
  });

  return (
    <div className='bg-gray-100 p-4 mb-4 text-gray-500 font-regular text-sm uppercase tracking-wider '>
      {links.map((item) => {
        <p key={item.url}>{item.url}lo</p>;
      })}
    </div>
  );
};

export default Header;
